    {field: 'score', headerName: 'Score'}
]

const rows = [
    {ranking: 1, username: 'Stone', score: 20},
    {ranking: 2, username: 'Stone', score: 20},
]

function Leaderboard() {
    return (
        <DataGrid columns={columns} pageSize={20} />
    )
}

export default Leaderboard;
